query getProductAvailability($input: ProductAvailabilityQueryInput!) {
  getProductAvailability(input: $input) {
    postcode
    country
    region
    availability {
      HOME_DELIVERY {
        keycode
        poolName
        stock {
          available
          __typename
        }
        __typename
      }
      CLICK_AND_COLLECT {
        keycode
        stock {
          totalAvailable
          __typename
        }
        locations {
          fulfilment {
            isBuddyLocation
            locationId
            stock {
              available
              __typename
            }
            __typename
          }
          location {
            locationId
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

mutation createMyShoppingList($quantity: Int!, $sku: String!, $version: Long) {
  addItemToShoppingList(version: $version, sku: $sku, quantity: $quantity) {
    lineItems {
      id
      quantity
      variant {
        id
        sku
        __typename
      }
      __typename
    }
    id
    version
    __typename
  }
}
